import alert from '../images/alert.png'

let style = {
    width: 100,
    height: 30,
    backgroundColor: "#063b50",
    marginRight: 2,
    cursor: 'pointer',
}

let img = {
    width: 18, 
    margin: 'auto', 
    paddingTop: 5, 
    display: 'flex'
}


export default function Alerts() {
    return (
        <div style={style}>
            <img style={img} src={alert} alt=''/>
        </div>
    )
}
